import axios from 'axios';
import {ACTIVITY_ACQUIRED} from './types';

export const getActivities = () => dispatch => {
    console.log("hi");
    axios.get(`/api/activity`).then(res => {
        console.log(res.data)
        dispatch({
        type: ACTIVITY_ACQUIRED,
        payload: res.data
        })
    }
    );
};
